def main():
    previous_percent = -1
    for n, (op, kwarg) in enumerate(operations):
        new_percent = 100*(n+1)/len(operations)
        if new_percent != previous_percent:
            print('{:.2}%'.format(new_percent))
            previous_percent = new_percent
        op(**kwarg)


